import ReactFragment from 'react'

export default function EventList({events}) {
  return (
    events.map((event, index) => (
        <ReactFragment key={event.id}>
            <h2>{index} - {event.title}</h2>
            <button onClick={() => handleClick(event.id)}>remove event</button>
        </ReactFragment> 
        )
    )
  )
}
